                      <option>GK</option>
                      <option>RB</option>
                      <option>CB</option>
                      <option>LB</option>
                      <option>RWB</option>
                      <option>LWB</option>
                      <option>CDM</option>
                      <option>CM</option>
                      <option>CAM</option>
                      <option>RM</option>
                      <option>LM</option>
                      <option>RW</option>
                      <option>LW</option>
                      <option>CF</option>
                      <option>ST</option>
                    </Input>
                  </InputGroup>
                </Col>
